import React from 'react';
import PropTypes from 'prop-types';
import { withStyles, makeStyles } from '@material-ui/core/styles';
import ButtonBase from '@material-ui/core/ButtonBase';
import Container from '@material-ui/core/Container';
import Typography from '@material-ui/core/Typography';
import HomePageHeader from './homePageheader';


const styles = makeStyles((theme) => ({
  root: {
    marginTop: theme.spacing(8),
    marginBottom: theme.spacing(4),
  },
  images: {
    marginTop: theme.spacing(8),
    display: 'flex',
    flexWrap: 'wrap',
  },
  imageWrapper: {
    position: 'relative',
    display: 'block',
    padding: 0,
    borderRadius: 0,
    height: '40vh',
    [theme.breakpoints.down('sm')]: {
      width: '100% !important',
      height: 100,
    },
    '&:hover': {
      zIndex: 1,
    },
    '&:hover $imageBackdrop': {
      opacity: 0.15,
    },
    '&:hover $imageMarked': {
      opacity: 0,
    },
    '&:hover $imageTitle': {
      border: '4px solid currentColor',
    },
  },
  imageButton: {
    position: 'absolute',
    left: 0,
    right: 0,
    top: 0,
    bottom: 0,
    display: 'flex',
    alignItems: 'center',
    justifyContent: 'center',
    color: theme.palette.common.white,
  },
  imageSrc: {
    position: 'absolute',
    left: 0,
    right: 0,
    top: 0,
    bottom: 0,
    backgroundSize: 'cover',
    backgroundPosition: 'center 40%',
  },
  imageBackdrop: {
    position: 'absolute',
    left: 0,
    right: 0,
    top: 0,
    bottom: 0,
    background: theme.palette.common.black,
    opacity: 0.5,
    transition: theme.transitions.create('opacity'),
  },
  imageTitle: {
    position: 'relative',
    padding: `${theme.spacing(2)}px ${theme.spacing(4)}px 14px`,
  },
  imageMarked: {
    height: 3,
    width: 18,
    background: theme.palette.common.white,
    position: 'absolute',
    bottom: -2,
    left: 'calc(50% - 9px)',
    transition: theme.transitions.create('opacity'),
  },
}));

function ProductCategories(props) {
 const classes = styles();;

  const images = [
    {
      url:
      'https://encrypted-tbn0.gstatic.com/images?q=tbn%3AANd9GcRTLo8uHO7HuxF-hi299pATcjnAhMHM_bboLQ&usqp=CAU',
      title: 'Sad',
      width: '40%',
      purl:'./sad'
    },
    {
      url:
        'https://happinesson.com/wp-content/uploads/2019/08/how-to-be-happy-by-listening-to-music-blog-1080x608.jpg',
      title: 'Happy',
      width: '20%',
      purl:'happy'
    },
    {
      url:
        'https://assets-news-bcdn.dailyhunt.in/cmd/resize/400x400_80//fetchdata15/images/f2/14/b6/f214b6b04e913795a6d85139b6c9b619.jpg',
      title: 'Romatic',
      width: '40%',
      purl: './romantic'
    },
    {
      url:
        'data:image/jpeg;base64,',
      title: 'Tarab',
      width: '38%',
      purl:'./tarab'
    },
    {
      url:
        'https://cdn3.vectorstock.com/i/1000x1000/78/47/music-party-vector-267847.jpg',
      title: 'Sarcastic',
      width: '38%',
      purl:'./sarcastic'
    },
    {
      url:
        'https://image.shutterstock.com/image-photo/young-adult-girlfriends-having-fun-260nw-1057228151.jpg',
      title: 'Friends Drive',
      width: '24%',
      purl:'./workout'
    },
    {
      url:
        'data:image/jpeg;base64,',
      title: 'Calm',
      width: '40%',
      purl :'/calm'
    },
    {
      url:
        'https://encrypted-tbn0.gstatic.com/images?q=tbn%3AANd9GcT9hjogjbiJI020wZbnYABhPk-jk4wsEv-sRQ&usqp=CAU',
      title: 'Pop',
      width: '20%',
      purl :'/pop'
    },
    {
      url:
        'https://encrypted-tbn0.gstatic.com/images?q=tbn%3AANd9GcQm9H3NMwnb5DDyEZTzzBcTUfB6qUNXI75B1g&usqp=CAU',
      title: 'Jazz',
      width: '40%',
      purl :'/jazz'
    },
  ];

  return (
    <div>
    <HomePageHeader/>
    <Container className={classes.root} component="section">
      
      <Typography variant="h4" marked="center" align="center" component="h2">
        FOR ALL MOOD
      </Typography>
      <br/>
      <br/>
      <div className={classes.images}>
        {images.map((image) => (
          <ButtonBase
            key={image.title}
            className={classes.imageWrapper}
            style={{
              width: image.width,
            }}
            href={image.purl}
          >
            <div
              className={classes.imageSrc}
              style={{
                backgroundImage: `url(${image.url})`,
              }}
            />
            <div className={classes.imageBackdrop} />
            <div className={classes.imageButton}>
              <Typography
                component="h3"
                variant="h6"
                color="inherit"
                className={classes.imageTitle}
              >
                {image.title}
                <div className={classes.imageMarked} />
              </Typography>
            </div>
          </ButtonBase>
        ))}
       
     

       
      </div>
    </Container>
    </div>
  );
}

ProductCategories.propTypes = {
  classes: PropTypes.object.isRequired,
};

export default withStyles(styles)(ProductCategories);
